import React, { useState } from "react";
import Dashboard from "./components/Dashboard";
import Login from "./components/Login";

function App() {
  const [user, setUser] = useState(null);

  return (
    <div className="container py-5">
      {!user ? (
        <Login onLogin={(u) => setUser(u)} />
      ) : (
        <Dashboard user={user} />
      )}
    </div>
  );
}

export default App;
